import React, { useEffect, useState } from "react";
import Layout from "./components/layout/Layout";
import { Route, Switch } from "react-router-dom";
import Home from "./components/pages/Home";
import AllFighters from "./components/pages/AllFighters";
import NewFighter from "./components/pages/NewFighter";
import Login from "./components/pages/Login";
import Register from "./components/pages/Register";
import NewTournament from "./components/pages/NewTournament";
import AllTournaments from "./components/pages/AllTournaments";
import MyProfile from "./components/pages/MyProfile";

function App() {

  const [name, setName] = useState('');

  const [user, setUser] = useState('');

  useEffect(() => {
    (async () => {
      const response = await fetch("http://127.0.0.1:8000/api/user", {
        headers: { "Content-Type": "application/json" },
        credentials: "include",
      });

      const content = await response.json();
      console.log("IDE CONTENT", content);
      setName(content.name);
      setUser(content);
    })();
  },[]);

  

  return (
    <div>
      <Layout name={name} setName={setName}>
        <Switch>
          <Route path="/" exact>
            <Home name={name}/>
          </Route>
          <Route path="/all-fighters">
            <AllFighters/>
          </Route>
          <Route path="/new-fighter">
            <NewFighter/>
          </Route>
          <Route path="/login">
            <Login name={name} setName={setName}/>
          </Route>
          <Route path="/register">
            <Register/>
          </Route>
          <Route path="/my-profile" user={user}>
            <MyProfile/>
          </Route>
          <Route path="/new-tournament">
            <NewTournament/>
          </Route>
          <Route path="/all-tournaments">
            <AllTournaments/>
          </Route>
        </Switch>
      </Layout>
    </div>
  );
}

export default App;
